  text: "Quote:\r\n\t\r\n\t\r\n\t\t\r\n\t\t\t\r\n\t\t\t\t\r\n\t\t\t\t\tOriginally Posted by daycap\r\n\t\t\t\t\t\r\n\t\t\t\t\r\n\t\t\t\tNhững tấm ảnh chưa từng đc công bố của huyền thoại và ko đc lung linh cho lắm  \r\n\r\n\r\n\r\n\r\n\r\nẢnh cuối là em dìm hồi lớp 10 nhé \r\n\t\t\t\r\n\t\t\r\n\t\r\n\t\r\n\nCái em Pham Summer gì gì đó nhìn xinh hơn nhiều. Em Yến đc mỗi quả ảnh thần thánh còn đâu xấu"
